import React from 'react'
import { useState, useEffect } from 'react';


  

const Buyers = () => {
  const [latestUsers, setLatestUsers] = useState([]);

  useEffect(() => {
    async function fetchLatestUsers() {
      const response = await fetch('/buyerslist');
      const data = await response.json();
      setLatestUsers(data);
    }
    fetchLatestUsers();
  }, []);




return (
  <div>
    <h1>Latest User Registrations</h1>
    <ul>
      {latestUsers.map(user => {
        const date_string = user.date;
        const date_obj = new Date(date_string);
        const datelo = date_obj.toISOString().split('T')[0];
        return (
          <li key={user._id}>
            <p>Name: {user.name}</p>
            <p>Email: {user.email}</p>
            <p>Registration Date: {datelo}</p>
            <p>Car: {user.work}</p>
            
          </li>
        );
      })}
    </ul>
  </div>
);
}

export default Buyers
